window.bookSummaryJSON = "<p><b>She's resigned to being single. They're on a mission to change her mind.</b></p> <p>Ivy Noelle Winter is content with being a thirty-one-year-old unbonded omega with no prospects of a pack. She adores teaching fifth grade, she has wonderful friends—and that baking show marathon isn't going to watch itself.</p> <p>Until a snowstorm and power outage traps Ivy in her classroom after hours… with three men.</p> <p>Rome, the new alpha music teacher. James, the flirtatious beta vet he's bonded to. And Logan, the town's grumpy alpha electrician.</p> <p>Their scents call to Ivy and her body answers, setting off her first-ever mini-heat. When the pheromones settle, she gets a proposition beyond her wildest dreams—a chance to be a pack.</p> <p>But there's no such thing as a perfect courtship, especially when the biggest roadblock to happiness might be Ivy herself.</p> <p>A Pack for Winter <i>is a standalone, MMFM, why-choose, small-town romance. It is part of the Cozyverse shared universe, bringing you a cozy omegaverse full of heart, heat, and humor. Contains mature content. A complete list of content warnings can be found on the author's website.</i></p>"; 
